function jsFunction(value)
{

        sltmodel.appendChild(option);

    console.log(obj.id);

function mdl_slt(value)
{
    //send a request to the server for this make/model combo
    $.get(
    "./make/"+select.options[select.selectedIndex].value+"/model/"+value,
    //{paramOne : 1, paramX : 'abc'},
    {},
    function(data) {
        document.querySelector('#percap').innerHTML = ""
        document.querySelector('#percapnum').innerHTML= "";

        //alert('page content: ' + data);
        var pccount = data[0];
        var pccap =  data[1];

        let pccapl = Object.entries(pccap);
        let sorteed = pccapl.sort((a, b) => a[1] - b[1]);

        for (i = 0; i < sorteed.length;i++){
             document.querySelector('#percap').innerHTML += sorteed[i][0] +"</br>";

            var pcval = sorteed[i][1];
            document.querySelector('#percapnum').innerHTML += Number( pcval.toPrecision(3) )+"</br>";
        }

        document.querySelector('#pcodecount').innerHTML = ""
        document.querySelector('#pcodecountnum').innerHTML= "";

        let pccountl = Object.entries(pccount);
        let sorteed2 = pccountl.sort((a, b) => a[1] - b[1]);

        for (i = 0; i < sorteed2.length;i++){
             document.querySelector('#pcodecount').innerHTML += sorteed2[i][0] +"</br>";

            var pcval = sorteed2[i][1];
            document.querySelector('#pcodecountnum').innerHTML += Number(pcval)+"</br>";
        }
    
    }
    );

    //alert(value);
    if(value=="I20" && select.options[select.selectedIndex].value=="HYUNDAI"){
        //load the test data into the divs
        alert("OK");

        for(var i =0; i < obj2[3].length; i++){

//            document.querySelector('#pcodecount').innerHTML += obj2[1][i] +"</br>";

        }

}
